import { doesExist } from '@shared/utilities/common-util/common.util';

export abstract class AbstractBaseModel {
  constructor(arg?: any, extender?: any) {
    if (doesExist(arg)) {
      Object.keys(extender).forEach((key) => {
        if (doesExist(arg[key])) {
          extender[key] = arg[key];
        }
      });
    }
  }
}
